resources.string:
Bir yolculuğa başladığınızda, sistem, araç ve römorkunuzun birleşik ağırlığını tahmin etmek için motor-tork verilerini kullanır. Tahmin edilen ağırlık, aracın Nominal Brüt Kombine Ağırlığı'nı (Gross Combined Weight Rating - GCWR) aşarsa, sistem size uyarı verecektir. Tahmini ağırlıklar, fiili ağırlıklardan farklı olabilir. Uyarıda, araç veya römorkunuzun yüklü ağırlık ölçümü yer almaz.

Uyarı, aşağıdaki durumlarda devreye girmeyecektir:
• Özellik, römork kullanım uygulamasında açık değilse;
• Sistemin kombine araç ve römork ağırlığını tahmin etmek için yeterli hızlanma olayı yoksa;
• Tahmini ağırlık, aracın GCWR’sini aşmıyorsa.

Uyarıyı görürseniz, aracı güvenli bir şekilde durdurun ve bir ölçek kullanarak, araç ve römorkun aşırı yüklü olup olmadığını kontrol edin.

Uyarı:
• Bir yolculuğa başlamadan önce, mutlaka bir ölçek üzerinde yüklü kamyon ve römorkun fiili ağırlıklarını belirleyin.
• GCW Uyarısını, araç ve römorkun düzgün şekilde veya aşırı yüklendiğini belirlemek için asla kullanmayın.
• Aşırı yüklü bir araç veya römorku kesinlikle kullanmayın. Ölüm, ağır yaralanma veya mülk hasarı meydana gelebilir.

GCWR, aracınız ve römorkunuz için geçerli yük değerlendirmelerinden yalnızca biridir. GCW Uyarısı, şunları tahmin etmez:
• Aracın tek başına Nominal Brüt Araç Ağırlığı'nı (Gross Vehicle Weight Rating - GVWR) aşıp aşmadığını;
• Arka aks ağırlığının, Nominal Arka Brüt Aks Ağırlığı'nı (Rear Gross Axle Weight Rating - RGAWR) aşıp aşmadığını;
• Römorkun Nominal Römork Ağırlığı'nı (Trailer Weight Rating - TWR) aşıp aşmadığını;
• Römork dili ağırlığının, Nominal Maksimum Dil Ağırlığı'nı (Max Tongue Weight Rating) aşıp aşmadığını.

Araç, araç yükü, römork, römork yükü ve römork dili ağırlığının, bu yük derecelendirmelerinin altında olduğunu her zaman doğrulayın.
